import React from 'react';
import { Swiper, SwiperSlide } from 'swiper/react';
import SwiperCore, { EffectCube, Navigation, Autoplay } from 'swiper';
import './Slider.css';

import img from '../../test.JPG';

import 'swiper/swiper.scss';
import 'swiper/components/effect-cube/effect-cube.scss';
import 'swiper/components/navigation/navigation.scss';
import 'swiper/components/autoplay/autoplay.scss';


SwiperCore.use([EffectCube, Navigation, Autoplay]);

export default () => {
  return (
    <Swiper effect="cube" navigation autoplay className='cube'>
      <SwiperSlide className='slide'><img src={img} /></SwiperSlide>
      <SwiperSlide><img src={img} /></SwiperSlide>
      <SwiperSlide><img src={img} /></SwiperSlide>
      <SwiperSlide><img src={img} /></SwiperSlide>
      <SwiperSlide><img src={img} /><h1>yo yo</h1></SwiperSlide>
      <SwiperSlide><img src={img} /></SwiperSlide>
      <SwiperSlide><img src={img} /></SwiperSlide>
    </Swiper>
  );
};
